const ol = document.getElementById('container');

for (const character of data.characters) {
    ol.innerHTML += `<div class="card">
        <a href="hero.html?name=${character.name}">
            <img src="${character.image}" alt="img">
            <div class="container">
                <h4>${character.name}</h4>
                <p></p>
            </div>
        </a>
    </div>`;
}

document.addEventListener('DOMContentLoaded', function () {
    const searchForm = document.getElementById('search');
    const container = document.getElementById('container');

    searchForm.addEventListener('submit', function (event) {
        event.preventDefault();

        const searchTerm = searchForm.querySelector('input[type="search"]').value.toLowerCase();

        const cards = document.querySelectorAll('.card');
        cards.forEach(function (card) {
            const cardName = card.querySelector('a h4').textContent.toLowerCase();

            if (cardName.includes(searchTerm)) {
                card.style.display = 'inline-block';
            } else {
                card.style.display = 'none';
            }
        });
    });
});
